import { ReactNode, Ref } from 'react';

const Panel = ({
	children,
	compact,
	header,
	className,
	transparent,
}: {
	children?: ReactNode;
	compact?: boolean;
	header?: ReactNode;
	transparent?: boolean;
	className?: string;
}) => {
	return (
		<div
			className={
				'bg-secondary-bg w-full h-fit rounded-md' +
				(compact ? 'p-3' : 'p-6') +
				(className || '')
			}
		>
			{header && <div className="bg-tertiary-bg p-3">{header}</div>}
			{children}
		</div>
	);
};

export { Panel };
